import React, { useEffect } from 'react';
import Navbar from "./components/Navbar/Navbar.js"
import Employees from  "./components/Employees/Employees.js"
import EmpForm from  "./components/Employees/Form/EmpForm.js"
import { useDispatch } from 'react-redux';
import { getEmps } from "./actions/emps";

const App = () => {

    return (
	<div class="row justify-content-start">
        <div class="col-auto">
        	<Navbar />
        </div>
        <div class="col">
			<div class="row-lg">
				<Employees />
			</div>
			<div class="row-lg">
				<EmpForm />
			</div>
		</div>
    </div>
    )};

export default App;
